    false,nt"url": null,nt"notes": "On June 12, 2006 and June 2, 2009, nonu2010viable,
    addled bald eagle (Haliaeetus leucocephalus) eggs were collected from nests at Pontook
    Reservoir on the Androscoggin River and at Silver Lake, New Hampshire (NH), respectively.
    Egg contents were analyzed by the U.S. Fish and Wildlife Service for organochlorine
    compounds and trace elements. The contaminant analysis results are described in
    this report. Contaminant levels in the two NH eggs were compared to concentrations
    found in a longu2010term study of inland Maine bald eagle eggs conducted between
    2000 and 2009. Organic and trace element concentrations in the NH eggs fell within
    the ranges reported in the Maine bald eagle study. None of the contaminant levels
    detected in the two NH bald eagle eggs would be considered highly elevated compared
    to suggested toxicity threshold concentrations.",nt"license_title": "License
